-- ----------------------------
-- Table structure for city_config
-- ----------------------------
DROP TABLE IF EXISTS `city_config`;
CREATE TABLE `city_config` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id',
  `canonical_country_code` varchar(2) NOT NULL DEFAULT '' COMMENT '标准两字国家码',
  `city_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '城市id',
  `county_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '二级城市id',
  `product_id` int(11) NOT NULL DEFAULT '0' COMMENT '产品线id',
  `module_id` int(11) NOT NULL DEFAULT '0' COMMENT '配置数据的模块id 1：顶部导航, 2：计价配置,3：服务管控,5：分成比例,7：派单模式,8：司机注册,11：司机指派,13：热门地点,14：围栏计价',
  `config_type` int(11) NOT NULL DEFAULT '0' COMMENT '配置类型 0：长期配置,1：短期配置,2：预埋配置',
  `titan_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '0：数据未同步到titan, > 0：数据已同步到titan',
  `apollo_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '0：数据未同步到apollo\n\n> 0：数据已同步到apollo',
  `batch_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '0: 无效的batch_id\n\n其他：city_config_file表主键',
  `origin_id` bigint(20) NOT NULL DEFAULT '0' COMMENT 'city_config表的主键 -1: 第一条副本配置, 0: 该条配置为正本数据, >0: 正本数据id',
  `creator` varchar(128) NOT NULL DEFAULT '' COMMENT '数据创建人',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据创建时间',
  `updater` varchar(128) NOT NULL DEFAULT '' COMMENT '数据更新人',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据更新时间',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '0：修改中(该数据为草稿), 1：待审核（数据已完成编辑，等待审核人处理）,2：审核通过, 3：发布中, 4：未生效, 5：生效中,6：已失效,-1：审核拒绝, -2：已废弃, -3：发布失败',
  `detail_version` varchar(64) NOT NULL DEFAULT '' COMMENT '与city_config_detail的cversion保持一致',
  `is_deleted` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除 0 --> 否 1 --> 是',
  `group_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '组id。',
  `apollo_name` varchar(512) NOT NULL DEFAULT '' COMMENT 'apollo文件名称',
  `launch_key` varchar(128) NOT NULL DEFAULT '' COMMENT '灰度放量开关key',
  `scene_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '场景ID,CategoryId',
  `launch_key_status` int(11) DEFAULT '0' COMMENT '0:禁用 1:启用',
  `extra_filter` text COMMENT 'extra filter',
  `tk` varchar(128) NOT NULL DEFAULT '' COMMENT '第三方key',
  `system_code` varchar(32) NOT NULL DEFAULT '' COMMENT '系统标识码',
  PRIMARY KEY (`id`),
  KEY `city_config_tk_index` (`tk`),
  KEY `idx_group_id_index` (`group_id`),
  KEY `idx_module_id` (`module_id`),
  KEY `idx_query` (`canonical_country_code`,`status`,`county_id`,`city_id`,`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=122 DEFAULT CHARSET=utf8mb4 COMMENT='开城配置表';

